commits.content:
.button {
  padding: 0 48px;
  border-radius: 8px;
  background-color: $button-color;
  width: 100%;
  height: 56px;
  border: none;
  &:hover {
    background-color: #F8F8FA;
    border: 2px solid #F0F1F4;
    cursor: pointer;
  }
  &:hover > .text--button {
    color: #292929;
  }
}
